The iterate over collection template works fine but generates an unnecessary cast instead of using a typed iterator and is not generics aware.

This has the benefit of working both with J5 and older versions
But if I use that template, I will get an iterator and a cast, even if the list I used was a generic.
Invoking the template after:
List<String> l = new ArrayList<String>();

yields an untyped Iterator and an unneeded cast:

for (Iterator iter = l.iterator(); iter.hasNext();) {
  type element = (type) iter.next();
}

IMHO that template (or another one that would be J5 enabled in some way) should yield:
for (Iterator<String> iter = l.iterator(); iter.hasNext();) {
	String element = iter.next();
}


