The equals() and hashCode() generator in JDT generates different code when run twice on the same class.

The equals() Generator in JDT Source produces the following code when it
is run the first time. The following code is an example class.

public class Test {
	int a;
}

Generating equals() and hashCode() the first time:

public class Test {
	int a;

	public int hashCode() {
		final int PRIME = 31;
		int result = 1;
		result = PRIME * result + a;
		return result;
	}

	public boolean equals(Object obj) {
		if (this == obj)
			return true;
		if (obj == null)
			return false;
		if (getClass() != obj.getClass())
			return false;
		final Test other = (Test) obj;
		if (a != other.a)
			return false;
		return true;
	}
}

Generating equals() and hashCode() the second time produces slightly different code:

public class Test {
	int a;

	public int hashCode() {
		final int PRIME = 31;
		int result = super.hashCode();
		result = PRIME * result + a;
		return result;
	}

	public boolean equals(Object obj) {
		if (this == obj)
			return true;
		if (!super.equals(obj))
			return false;
		if (getClass() != obj.getClass())
			return false;
		final Test other = (Test) obj;
		if (a != other.a)
			return false;
		return true;
	}
}

Note the additional call to super.equals() and super.hashCode();

If it is run the second time (where it asks the user to overwrite the
already existing equals() and hashCode() methods), it generates different
code. The second variation is wrong, as it additionally calls
super.equals(). 

The JavaDoc of ... states: "To deal with reference types of fields and
with supertypes, the implementation calls hashCode() and equals() on
reference types of fields and on the superclass (except if the superclass
is Object)". It does call super.equals(), although the exmple class
directly subclasses java.lang.Object. The problem is that the operation searches
the hierarchy of types until it finds a superclass implementing equals() and hashCode().
It seems that if the target class already contains equals()/hashCode(), the algorithm finds itself.

The problem seems to be in this code in
org.eclipse.jdt.internal.corext.codemanipulation.GenerateHashCodeEqualsOperation:

	private boolean needsNoSuperCall(ITypeBinding typeBinding, String name,
ITypeBinding[] parameters) {
		Assert.isNotNull(typeBinding);
		IMethodBinding binding= findMethodInHierarchy(typeBinding, name,
parameters);
		if (binding != null)
			return
binding.getDeclaringClass().getQualifiedName().equals(JAVA_LANG_OBJECT);
		return true;
	}

"binding.getDeclaringClass().getQualifiedName()" returns "Test",
and therefor the method returns false. The refactoring thinks that "Test"
is a superclass and so we also need a call to super.equals().

Using Eclipse 3.2.0, Build ID M20060629-1905 on Win32
CVS-HEAD 3.3 as of 2006/08/19 is also affected.

Testcase GenerateHashCodeEqualsTest does not check generation of super() calls at all.

