Here is a fast developed implementation of a little workaround which traverses up the class-hierarchy to find the method:

**********************************************************
MethodSignature ms = (MethodSignature)jp.getSignature();
Method m = ms.getMethod();

// Method may be in a superclass
if (m == null) {
  // Travelling temp class
  Class clazz = ms.getDeclaringType().getSuperclass();  
  // Methodname
  String methodName = ms.getName(); 
  // Method-Parameter
  Class[] parameterTypes = ms.getParameterTypes();			

  // Go up the hierarchy until Object is reached
  while (clazz != Object.class) {
    try {
      m = clazz.getDeclaredMethod(methodName, parameterTypes);
      System.out.println("Found method in " + clazz);
      break;
    } catch (NoSuchMethodException e) {
      System.out.println("Found no method in " + clazz);
      // Go up the hierarchy
      clazz = clazz.getSuperclass();
    }
  }

  // No method could be found
  if (m == null)
    throw new NoSuchMethodError("Method '" +methodName+ "' couldn't be found in the class hierarchy of '" +ms.getDeclaringType()+ "'");
}
**********************************************************

