Then you can declare extension like this:
<extension point="org.eclipse.core.expressions.propertyTesters"> <propertyTester class="foo.SomePropertyTester" id="foo.SomePropertyTester" namespace="foo" properties="someProperty" type="org.eclipse.core.runtime.IAdaptable"/> </extension>
