I've registered a module artifact adapter which produces artifacts that extends WebResource. This allows to run artifacts in the common web browser because they are resolved as a HttpLaunchable if my launchable adapter is not available.

But this does not work because RunOnServerActionDelegate always runs through the list of all registered launchable adapters and does not care about a specific order. In fact it is a random order because it just takes the launchable adapter as they are registered in the extension registry and this unordered.

The problematic code section is around line 251:

// get the launchable adapter and module object
ILaunchableAdapter launchableAdapter = null;
Object launchable = null;
ILaunchableAdapter[] adapters = ServerPlugin.getLaunchableAdapters();
if (adapters != null) {
  int size2 = adapters.length;
  for (int j = 0; j < size2; j++) {
    ILaunchableAdapter adapter = adapters[j];
    try {
      Object launchable2 = adapter.getLaunchable(server, moduleArtifact);
      Trace.trace(Trace.FINEST, "adapter= " + adapter + ", launchable= " + launchable2);
      if (launchable2 != null) {
        launchableAdapter = adapter;
        launchable = launchable2;
      }
    } catch (Exception e) {
      Trace.trace(Trace.SEVERE, "Error in launchable adapter", e);
    }
  }
}

Either this code should break out of the loop after a launchable was found and prevent overwriting with a different launchable or there should be a priority and a defined order for the launchable adapters.

I've confirmed by working with Angel that this is a dup of bug 152146. If a publish task alters the workspace, you'll get a second publish (and more if the tasks keeps going unnecessarily) unless you use the workaround of adding the following three lines after your task is done modifying files:

// first line is only required if you make a change that requires a build
project.build(IncrementalProjectBuilder.INCREMENTAL_BUILD,null); 
server.getServerPublishInfo().clearCache();
server.getServerPublishInfo().startCaching();

Once you add this code, only one publish should occur. Bug 152146 will be used to request proper API/support for this in the next release.

